import styled from 'styled-components';

export const FullPageContainer = styled.section`
  background: linear-gradient(
    ${({ theme }) => theme.colors.softViolet},
    ${({ theme }) => theme.colors.softBlue}
  );
  width: 100vw;
  min-height: 100vh;
`;

export const FaqBlock = styled.main``;
